import Note from './Note';

const NoteList = ({notes}) => {
    return(
        <div className="notes-list">
            {notes.map((note)=> (
                <Note id={note.id} text={note.text} date={note.date}></Note>)
            )}
        </div>
    );
};

export default NoteList;
